import React, { useState } from "react";
import { Link } from "react-router-dom";
import * as FaIcons from "react-icons/fa";
import * as MdIcons from "react-icons/md";
import { SidebarData } from "./SidebarData";
import { IconContext } from "react-icons";
import { NavLink, Routes, Route } from 'react-router-dom'
import "./Navbar.css";

function Navbar() {
    const [sidebar, setSidebar] = useState(false);

    const showSidebar = () => {
        setSidebar(!sidebar);
    };

    return (
        <>
            <IconContext.Provider value={{ color: "eeeeee" }}>
                <div className="navbar">
                <header className="header">
                <h3>CODINGMARKET</h3>
</header>
                    <Link to="#" className="menuBars">
                        <FaIcons.FaBars onClick={showSidebar} />
                    </Link>
                    <nav>
                    <ul className="list">

          <img src="https://reactjs.org/logo-og.png" alt="React Image"  width={70}/>
          <div class="action">
      <div class="profile" onclick="menuToggle();">
        <img src="./assets/avatar.jpg" />
      </div>
      <div class="menu">
        <h3>Someone Famous<br /><span>Website Designer</span></h3>
        <ul>
          <li>
            <img src="./assets/icons/user.png" /><a href="#">My profile</a>
          </li>
          <li>
            <img src="./assets/icons/edit.png" /><a href="#">Edit profile</a>
          </li>
          <li>
            <img src="./assets/icons/envelope.png" /><a href="#">Inbox</a>
          </li>
          <li>
            <img src="./assets/icons/settings.png" /><a href="#">Setting</a>
          </li>
          <li><img src="./assets/icons/question.png" /><a href="#">Help</a></li>
          <li>
            <img src="./assets/icons/log-out.png" /><a href="#">Logout</a>
          </li>
        </ul>
      </div>
    </div>
        </ul>

    </nav>
                </div>



                <nav className={sidebar ? "navMenu active" : "navMenu"}>
                    <ul className="navMenuItems" onClick={showSidebar}>
                        <li className="navbarToggle">
                            <Link to="#" className="menuBars">

                            </Link>
                        </li>
                        {SidebarData.map((item, index) => {
                            return (
                                <li key={index} className={item.className}>
                                    <Link to={item.path}>
                                        {item.icon}
                                        <span>{item.title}</span>
                                    </Link>
                                </li>

                            );
                        })}
                    </ul>
                </nav>
            </IconContext.Provider>
        </>
    );
}

export default Navbar;
